import React from "react";

const AboutUs = () => {
  return (
    <section className="about-us-section">
      <h2>Bem-vindo à HomeCare</h2>
      <p>
        A HomeCare é uma empresa portuguesa dedicada à melhoria e personalização
        dos serviços de saúde. Sabemos que cada pessoa é única e oferecemos
        soluções que se adaptam às suas necessidades.
      </p>
    </section>
  );
};

export default AboutUs;
